import React, { useState } from 'react';
import { Route, Redirect } from 'react-router-dom';

export const [auth] = useState(true)

export const PrivateRoute = ({ 
    auth, 
    component: Component, 
    ...rest 
    }) => {
        return(
            <Route
                {...rest}
                render = { props => 
                auth ?(
                    <Component{...props} />
                    ):(
                        <Redirect to="/" />
                    )
                }
            />
        )
    }

export default PrivateRoute;
